INSERT INTO "exercises" VALUES(16,'熊步',NULL,'2013-05-19 06:59:51.395856','2013-05-19 07:01:33.194887','双手撑在脚前约30公分处的地面上，然后开始手脚并用地向前爬。','PUSH',2,1);
INSERT INTO "exercises" VALUES(17,'宽距俯卧撑',NULL,'2013-05-19 07:03:30.568409','2013-05-19 07:03:30.568409','动作要领和标准俯卧撑一样，只不过你双手之间的距离要比肩宽，这样能更多地锻炼到你的胸肌。','PUSH',12,1);
INSERT INTO "exercises" VALUES(18,'沉肩俯卧撑',NULL,'2013-05-19 07:05:17.533811','2013-05-19 07:05:17.533811','这个动作的要领也和标准俯卧撑一样，只不过你每次放低身体时要尽可能地放低一侧肩膀，而另一侧的肩膀则要尽可能地高。','PUSH',12,1);
INSERT INTO "exercises" VALUES(19,'深度俯卧撑',NULL,'2013-05-19 07:06:42.325322','2013-05-19 07:06:42.325322','做俯卧撑时将胸部降得低于你的双手。','PUSH',12,1);
INSERT INTO "exercises" VALUES(20,'错手俯卧撑',NULL,'2013-05-19 07:08:11.037928','2013-05-19 07:08:11.037928','动作要领和标准俯卧撑一样，只不过其中一只手的位置要比标准俯卧撑靠前，而另一只手的位置则要稍稍靠后。','PUSH',14,1);
INSERT INTO "exercises" VALUES(21,'推手起身',NULL,'2013-05-19 07:11:27.560302','2013-05-19 07:11:27.560302','增强爆发力的好办法！站在一个有一定高度的平台前，如书桌、壁炉架或窗台。身体倒向平台，最后用手掌撑住，掌心向下。然后，有控制地放低身体，直到下胸部接触到平台。接着，尽可能快地将自己推起，用的力量要足够把自己推回到直立的位置，在整个过程中身体始终要成一条直线。','PUSH',30,1);
INSERT INTO "exercises" VALUES(22,'反弹俯卧撑',NULL,'2013-05-19 07:14:56.216173','2013-05-19 07:14:56.216173','动作要领和标准俯卧撑一样，只不过将自己推起的力量要足够大，速度要足够快，使得你的双手在手臂伸直达到动作的最高点时离开地面。在落回地面时，不要全无控制地让双手拍在地上，而应该指尖先着地，然后是手掌，之后胳膊弯曲，让身体有控制地落下，到达动作的最低点时再迅速且有力地将自己推起。','PUSH',8,1);
INSERT INTO "exercises" VALUES(23,'篮球俯卧撑',NULL,'2013-05-19 07:15:51.914226','2013-05-19 07:15:51.914226','动作要领和标准俯卧撑一样，只不过有一只手要撑在篮球上。','PUSH',8,1);
INSERT INTO "exercises" VALUES(24,'登山',NULL,'2013-05-19 07:19:50.839956','2013-05-19 07:19:50.839956','从标准俯卧撑的起始姿势开始，颈部、脊椎、尾椎骨和腿成一条直线，肘部伸直，锁定双臂，双手在双肩的正下方。然后，身体其他部位完全保持不动，弯曲左腿，让左膝贴近胸部，左脚着地。“跳”一下，蹬直左腿，使其回到起始位置，与此同时弯曲右腿，右膝贴近胸部。快节奏地做这个练习，持续一定时间或重复一定次数，看起来像是你正在保持着俯卧撑姿势的同时原地奔跑。','PUSH',4,1);
INSERT INTO "exercises" VALUES(25,'直板爬行',NULL,'2013-05-19 07:20:51.753930','2013-05-19 07:20:51.753930','','PUSH',8,1);
