INSERT INTO "exercises" VALUES(34,'蟹行',NULL,'2013-05-19 07:28:28.999565','2013-05-19 07:28:28.999565','坐在地板上，屈膝。双手撑在身体两侧的地上，手掌向下，抬高臀部。现在，开始像螃蟹一样前后“踱步”。','PUSH',2,1);
INSERT INTO "exercises" VALUES(35,'桌式挺髋',NULL,'2013-05-19 07:29:32.084085','2013-05-19 07:29:32.084085','','PUSH',4,1);
INSERT INTO "exercises" VALUES(36,'尖刀',NULL,'2013-05-19 07:29:51.569041','2013-05-19 07:31:33.187478','背部着地，双臂放在身体两侧的地面上，支撑身体。向上抬起双腿，直到它们垂直于地面，在这一过程中，双腿要保持笔直。双臂在地面上支撑身体，尽可能高地抬高髋部，双腿始终竖直向上。接着，换换放下髋部。','PUSH',24,1);
INSERT INTO "exercises" VALUES(37,'中式俯卧撑',NULL,'2013-05-19 07:32:13.724376','2013-05-19 07:32:13.724376','','PUSH',28,1);
