INSERT INTO "exercises" VALUES(43,'旋臂',NULL,'2013-05-19 07:36:58.259356','2013-05-19 07:36:58.259356','这个动作十分适合在更高强度的动作前后做，用于热身或放松，也适合那些因伤病或年龄的原因而久不健身的人。站立，双臂侧平举，注意让双臂保持笔直。双臂在空中划圆（幅度可大可小），向前10次，再向后10次。','PUSH',2,1);
INSERT INTO "exercises" VALUES(44,'猴子俯卧撑',NULL,'2013-05-19 07:37:42.693194','2013-05-19 07:37:42.693194','','PUSH',8,1);
INSERT INTO "exercises" VALUES(45,'烈焰当头',NULL,'2013-05-19 07:38:07.120913','2013-05-19 07:38:07.120913','','PUSH',24,1);
INSERT INTO "exercises" VALUES(46,'顶上推举',NULL,'2013-05-19 07:40:24.719289','2013-05-19 07:40:24.719289','站立，双脚与肩同宽，把一个重物举到胸前。腹部收紧，背部挺直，双臂上举，将重物举国头顶，直到你的双臂锁定。在动作的最高点尽量高地耸肩，收缩肌肉，保持这个状态1~2秒。','PUSH',30,1);
INSERT INTO "exercises" VALUES(47,'大拇哥',NULL,'2013-05-19 07:42:02.404071','2013-05-19 07:42:02.404071','俯卧，双臂侧平举，双手握拳，大拇指指向正上方。然后，抬起肩膀和头部，双臂伸直，尽最大力气抬高双臂，在动作最高点收缩你肩部的肌肉。','PUSH',12,1);
INSERT INTO "exercises" VALUES(48,'侧平举',NULL,'2013-05-19 07:42:14.647404','2013-05-19 07:42:14.647404','','PUSH',30,1);
INSERT INTO "exercises" VALUES(49,'俯身侧平举',NULL,'2013-05-19 07:42:48.000515','2013-05-19 07:42:48.000515','','PUSH',30,1);
