INSERT INTO "exercises" VALUES(57,'静力弯举',NULL,'2013-05-19 07:53:11.115662','2013-05-19 07:53:11.115662','做这个练习根本不需要借助任何东西。你只需要用一只手抓住另一只手的手腕，使劲向下压，力量大到你的另一只手臂几乎不能像在其他类型的弯举中那样抬起来。',NULL,30,2);
INSERT INTO "exercises" VALUES(58,'腕弯举',NULL,'2013-05-19 07:53:49.817885','2013-05-19 07:53:49.817885','',NULL,30,2);
INSERT INTO "exercises" VALUES(59,'鹰爪',NULL,'2013-05-19 07:56:23.816578','2013-05-19 07:56:23.816578','这个练习很简单，却很有效。你要反复地张开手指，然后再紧紧握拳，要尽可能地快而有力。张开手指时，手指要张开得尽可能地宽，保持半秒，然后以闪电般的速度收回手指，紧握拳头，同样保持半秒，接着再次尽可能快地张开手指，如此不间断地做50~100次就可以了。',NULL,2,2);
INSERT INTO "exercises" VALUES(60,'早上好（直立体前屈）',NULL,'2013-05-19 07:59:19.836212','2013-05-19 07:59:19.836212','站立，双脚与肩同宽，双手放在颈后；然后，俯身向前，只弯曲髋部，背部成反弓形（胸部前挺，臀部翘起），双腿几乎伸直。',NULL,2,4);
INSERT INTO "exercises" VALUES(61,'脏狗（跪姿侧抬腿）',NULL,'2013-05-19 08:01:56.645903','2013-05-19 08:01:56.645903','四肢着地，双手与肩同宽，背部挺直，膝关节弯曲90°。保持膝关节弯曲90°，右腿尽可能高地向体侧抬起，用力收紧你的臀部肌肉。',NULL,2,4);
INSERT INTO "exercises" VALUES(62,'驴踢（跪姿后抬腿）',NULL,'2013-05-19 08:03:45.029226','2013-05-19 08:03:45.029226','四肢着地，双手与肩同宽，背部挺直，膝关节弯曲90°。缓慢地将你的右腿向后踢出，并尽可能高地向上抬起，髋部摆正，保持不动；然后，把腿放下，回到起始姿势，换左腿继续练习。',NULL,2,4);
